INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (126001, 2, 40011, 1, "クリア", 322, 2, 1, 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001);
