INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (126001, 5, 40011, 2, "クリア", 325, 2, 1, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001);
